"""
给你一个二维整数数组 items ，其中 items[i] = [pricei, beautyi] 分别表示每一个物品的 价格 和 美丽值 。
同时给你一个下标从 0 开始的整数数组 queries 。对于每个查询 queries[j] ，你想求出价格小于等于 queries[j] 的物品中，最大的美丽值 是多少。如果不存在符合条件的物品，那么查询的结果为 0 。
请你返回一个长度与 queries 相同的数组 answer，其中 answer[j]是第 j 个查询的答案。
示例 1：
输入：items = [[1,2],[3,2],[2,4],[5,6],[3,5]], queries = [1,2,3,4,5,6]
输出：[2,4,5,5,6,6]
解释：
- queries[0]=1 ，[1,2] 是唯一价格 <= 1 的物品。所以这个查询的答案为 2 。
- queries[1]=2 ，符合条件的物品有 [1,2] 和 [2,4] 。
  它们中的最大美丽值为 4 。
- queries[2]=3 和 queries[3]=4 ，符合条件的物品都为 [1,2] ，[3,2] ，[2,4] 和 [3,5] 。
  它们中的最大美丽值为 5 。
- queries[4]=5 和 queries[5]=6 ，所有物品都符合条件。
  所以，答案为所有物品中的最大美丽值，为 6 。
示例 2：
输入：items = [[1,2],[1,2],[1,3],[1,4]], queries = [1]
输出：[4]
解释：
每个物品的价格均为 1 ，所以我们选择最大美丽值 4 。
注意，多个物品可能有相同的价格和美丽值。
示例 3：
输入：items = [[10,1000]], queries = [5]
输出：[0]
解释：没有物品的价格小于等于 5 ，所以没有物品可以选择。因此，查询的结果为 0 。
"""

def maximumBeauty( items, queries):
    items.sort(key = lambda x: x[0])
    temp = {items[0][0]:items[0][1]}
    start = items[0][0]
    for i in range(1, len(items)):
        if items[i][0] not in temp.keys():
            if items[i][1] > temp[start]:
                temp[items[i][0]] = items[i][1]
            else:
                temp[items[i][0]] = temp[start]
        else:
            if temp[items[i][0]] < items[i][1]:
                temp[items[i][0]] = items[i][1]
        start = items[i][0]

    res = []
    for j in queries:
        left = 0
        right = len(items)
        while left < right:
            mid = left + (right-left)//2
            if j > items[mid][0]:
                left = mid+1
            elif j < items[mid][0]:
                right = mid
            else:
                res.append(temp[items[mid][0]])
                break

